function PronamicMapsFields(sourceElement,targetElements={}){if(sourceElement===null){return}fetch("/wp-json/pronamic-maps/v1/address/"+sourceElement.value).then((response=>response.json())).then((data=>PronamicMapsAutopopulateFields(data,targetElements)))}function PronamicMapsAutopopulateFields(data,targetElements){if(targetElements.address!==undefined&&targetElements.street_number!==undefined){targetElements.address.value=data.address.street+" "+data.address.street_number}if(targetElements.address!==undefined){targetElements.address.value=data.address.street}if(targetElements.city!==undefined){targetElements.city.value=data.address.city}}sourceElement=document.getElementById("input_3_3");targetElements={address:document.getElementById("input_3_2"),city:document.getElementById("input_3_4")};PronamicMapsFields(sourceElement,targetElements);